About:
Another great collaboration of Kick Bong &amp; Squazoid. Ethnic grooves blended with psychedelic parts and downbeat elements, promising flavors from chill to tribal dance.
Kick Bong &amp; Squazoid team up again with their special style, sharing their ethnic vision with all the tribes of the universe. Fusing ethnic vibes and twisted flavors with chilled out electronica and top notch production, this will get an unusual yet pleasant reaction out of any audience. Play this and let your inner ethno-freak out for a wander in the bushes.

Credits:
written and produced by Franck Jousselin and Jeremy Bringue
